import React from 'react';

function App() {
  return (
    <div className="App">

      <div class="container">
        <div class="row">
          <div class="col">
            1 of 2
          </div>
          <div class="col">
            2 of 2
          </div>
        </div>
      </div>

    </div>
  );
}

export default App;
